    to your letter referencing a discrepency in our Year End 2010 Report. The error
    was due to an open amended report from the 30 Day Post Election 2010 that was
    not yet filed, causing the Closing and Opening Cash on Hand amount to differ.
    This subsequently also resulted in the lines referenced in your letter to appear
    inaccurate. SpinePAC has since closed and filed an amended 30 Day Post Election
    report for 2010. This report has also been amended and refiled, addressing your
    concerns with the reports in question.\n"
